 ('performance','We have ramped up performance in dealing with the asylum legacy cases and are now resolving several thousand every month.','우리는 밀려있는 이민신청을 처리하는 업무를 늘려 왔으며 이제는 매달 수천 건씩을 해결하고 있습니다.','2015-07-17 오후 8:27:52','',1),
 ('performance','Use trustnet.com to compare fund performance.','펀드  성과 를 비교하기 위해 trustnet.com을 사용하라.','2015-07-17 오후 8:27:53','',2),
 ('performance','UK economy, perpetuate our poor performance.','영국 경제는 우리의 저조한  성과 를 영속화시킨다.','2015-07-17 오후 8:27:53','',2),
 ('performance','The UK and Korea drove the retail performance.','영국과 한국은 소매 실적을 촉진하였다','2015-07-17 오후 8:27:53','',2),
