 ('producer','Just as the profs say in their article, the NHS panders to producer interests.','기고문에서 그 교수들이 말한 것처럼, NHS는  생산자 들의 이익을 이용하는 것이다.','2015-07-17 오후 8:35:45','',2),
 ('producer','Steven Moffat, who wrote much-lauded Doctor Who episodes including The Empty Child and Blink, is the new lead writer and executive producer.','공허한 아이와 우는천사 에피소드를 포함한 많은 훌륭한 닥터후 에피소드를 쓴 스티븐 모팻은 새 수석작가이자 총 제작자 이다.','2015-07-17 오후 8:35:45','',2),
 ('producer','The music industry is his baby and he knows everything there is to know about it: music, songs, producers, writers.','음악산업은 그의 주요 관심사이다 그는 그것에 관해 알아야할 모든것,예를들면 음악,노래, 제작자 , 작곡가등에 관한 모든것,을 알고 있다','2015-07-17 오후 8:35:45','',2),
