 ('drop','What we do is less than a drop in the ocean. But if it were missing, the ocean would lack something. (Mother Teresa)','우리가 하는 일은 바다에 붓는 한  방울 의 물보다 하찮은 것이다. 하지만 그 한  방울 이 없다면 바다는 그만큼 줄어들 것이다. (마더 테레사, 노력명언)','2015-07-17 오후 8:40:38','출처:명언/속담',11),
 ('drop','Peace has never come from dropping bombs. Real peace comes from enlightenment and educating people to behave more in a divine manner. (Carlos Santana)','평화는 결코 폭탄 투하에서 비롯된 적이 없다. 진정한 평화는 깨달음 그리고 사람들이 신성한 방식으로 더 많이 행동하도록 교육하는 것에서 온다. (칼로스 산타나, 전쟁명언)','2015-07-17 오후 8:40:38','출처:명언/속담',11),
 ('drop','Drop by drop fills the tub.','한  방울  한 방울 이 통을 채운다. 티끌모아 태산 (서양속담, 돈속담)','2015-07-17 오후 8:40:38','출처:명언/속담',12),
 ('drop','A drop of honey catches more flies than a barrel of vinegar.','꿀 한 방울 이 한 통의 식초보다 더 많은 파리를 잡는다. (네덜란드속담, 자신감속담)','2015-07-17 오후 8:40:38','출처:명언/속담',12),
 ('drop','A drop of fortune is worth a cask of wisdom.','한  방울 의 행운은 한 통의  지혜만큼 가치가 있다. (라틴속담, 행운속담)','2015-07-17 오후 8:40:38','출처:명언/속담',12),
