 ('court','The two princes and the princess had prepared a magnificent repast for the emperor and queen and their court.','두 왕자와 공주들은 황제와 여왕 그리고 그들의 궁전을 위해 성대한 식사를 준비했다.','2015-07-17 오후 9:56:50','',13),
