 ('court','My brother has the authority of the courts to be a pleader for criminals.','나의 남자형제는 범죄자들을 위해 변호하는 법원의 권력을 가지고 있다.','2015-07-17 오후 9:56:50','',13),
 ('understanding','Thank you for your understanding in this matter.','이 건에 관해 양해해 주셔서 감사합니다.','2015-07-17 오후 9:57:54','출처:YBM',0),
