 ('understanding','There are all manner of things that defy understanding.','이해를 거부하는 모든 방법이있다.','2015-07-17 오후 9:57:54','',0),
 ('understanding','A better understanding our ocean world can help unlock mysteries of the universe.','우리들의 해양세계를 잘  이해하는 것이 우리가 우주의 신비를  이해하는데  도움이 된다.','2015-07-17 오후 9:57:57','',3),
 ('understanding','Much learning does not teach understanding. (Heraclitus)','많은 공부와 지식이 곧 지혜로 연결되는 것은 아니다. (헤라클레이토스, 공부명언)','2015-07-17 오후 9:57:58','출처:명언/속담',11),
 ('understanding','Peace cannot be kept by force. It can only be achieved by understanding. (Albert Einstein)','평화는 무력으로 유지될 수 없다. 오직 이해를 통해 유지될 수 있다. (알버트 아인슈타인, 전쟁명언)','2015-07-17 오후 9:57:58','출처:명언/속담',11),
 ('understanding','I do not want the peace which passeth understanding, I want the understanding which bringeth peace. (Helen Keller)','나는 합의를 거친 평화는 원치 않는다. 나는 평화를 가져오는 합의를 원한다. (헬렌 켈러, 전쟁명언)','2015-07-17 오후 9:57:58','출처:명언/속담',11),
 ('understanding','The highest activity a human being can attain is learning for understanding, because to understand is to be free. (Baruch Spinoza)','인간이 획득할 수 있는 가장 고결한 행동은  이해하기  위한 배움이다.  이해하면  자유로워지기 때문이다. (바뤼흐 스피노자, 자유명언)','2015-07-17 오후 9:57:58','출처:명언/속담',11),
 ('understanding','What else is love but understanding and rejoicing in the fact that another person lives, acts, and experiences otherwise than we do? (Friedrich Nietzsche)','남들이 우리와 다르게 살아가고 행동하며 경험한다는 사실을  알고  이에 기뻐하는 것이 사랑 아니고 무엇이겠는가? (프레드리히 니체, 사랑명언)','2015-07-17 오후 9:57:58','출처:명언/속담',11),
