 ('most','You win some, but you lose most.','너가 몇몇 곳에서 성공할 수는 있지만, 실패하는 것이 더 많다.','2015-07-17 오후 9:59:16','',3),
 ('most','Packet switching: How most data networks work.','패키 교환:  대부분 의 데이터 네트웍이 동작하는 방식.','2015-07-17 오후 9:59:16','',3),
 ('most','But most of the time we were disappointed.','그렇지만  대부분  우리는 실망했습니다.','2015-07-17 오후 9:59:16','',3),
 ('most','In most cases, catastrophe is winning.','거의 모든 경우에 있어서 재앙이 승리한다.','2015-07-17 오후 9:59:16','',3),
 ('most','Everyone is born with genius, but most people only keep it a few minutes. (Edgard Varese)','모든 사람은 천재성을 갖고 태어나지만,  대부분 의 사람은 그것을 단지 몇분간만 유지한다. (에드가 바레즈, 자신감명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','The most incomprehensible thing about the world is that it is at all comprehensible. (Albert Einstein)','이 세상에서  가장  이해할 수 없는 말은 이 세상을 이해할 수 있다는 말이다. (알버트 아인슈타인, 지혜명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','I tend to live in the past because most of my life is there. (Herb Caen)','나는 과거 속에 사는 편인데 내 생애  대부분 이 거기 있기 때문이다. (허브 캐언, 시간명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Tis the most tender part of love, each other to forgive. (John Sheffield)','서로를 용서하는 것이야말로  가장  아름다운 사랑의 모습이다. (존 셰필드, 사랑명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Food is the most primitive form of comfort. (Sheila Graham)','음식은  가장  원시적인 형태의 위안거리다. (쉴라 그레이엄, 음식명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','The most wasted of all days is one without laughter. (E. E. Cummings)','인생에서  가장  의미없이 보낸 날은 웃지 않고 보낸 날이다. (E. E. 커밍스, 희망명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','The most profound statements are often said in silence. (Lynn Johnston)',' 가장  심오한 발언은 종종 침묵 속에 나오는 경우가 많다. (린 존스턴, 침묵명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Humor is by far the most significant activity of the human brain. (Edward De Bono)','유머는 단연코 두뇌의  가장  중요한 활동이다. (에드워드 드 보노, 자기관리명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','The most courageous act is still to think for yourself. Aloud. (Gabriel Coco Chanel)',' 가장  용감한 행동은 자신만을 생각하는 것이다. 큰 소리로. (가브리엘(코코) 샤넬, 자신감명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','The most exciting attractions are between two opposites that never meet. (Andy Warhol)',' 가장  자극적인 매력은 결코 만나지 않는 양극 간에 존재한다. (앤디 워홀, 아름다움명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','The place where optimism most flourishes is the lunatic asylum. (Havelock Ellis)','낙관론이  가장  많이 꽃피는 곳은 정신병원이다. (해브록 엘리스 , 희망명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Gratitude is the most exquisite form of courtesy. (Jacques Maritain)','감사는 정중함의  가장  아름다운 표현이다. (자크 마리탱, 겸손명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Time is the most valuable thing a man can spend. (Theophrastus)','시간은 인간이 쓸 수 있는  가장  값진 것이다. (테오프라스토스, 시간명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Excessive productivity can bring the most gifted man almost to madness. (Friedrich Nietzsche)','지나친 생산성은 천재도 미치기 직전까지 몰고갈 수 있다. (프레드리히 니체, 실패명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Humankind differs from the animals only by a little, and most people throw that away. (Confucius)','사람과 짐승은 소소한 차이가 있을 뿐이고,  대부분 의 사람은 그 차이조차 없다. (공자, 겸손명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','With most men, unbelief in one thing springs from blind belief in another. (Georg Christoph Lichtenberg)','무엇에 대한 불신은 또다른 무엇에 대한 맹신에서 비롯된다. (게오로크 크리스토프 리히텐베르크, 믿음명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Politeness, n. The most acceptable hypocrisy. (Ambrose Bierce)','예의: 명사.  가장  쉽게 받아들일 수 있는 위선 (앰브로즈 비어스, 겸손명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','Liberty means responsibility. That is why most men dread it. (George Bernard Shaw)','자유는 책임이다. 그래서  대부분 의 사람들은 자유를 두려워 한다. (조지 버나드 쇼, 자유명언)','2015-07-17 오후 9:59:16','출처:명언/속담',11),
 ('most','It is the wisest who grieve most at loss of time.','허송세월을  가장  슬퍼하는 사람은 현명한 사람이다. (서양속담, 노력속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','The boughs that bear most hang lowest.','열매 많은 가지는 밑으로 쳐져 있다.(벼는 익을수록 고개를 숙인다.) (서양속담, 겸손속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','The most wasted day is that in which we have not laughed.','우리가  가장  헛되이 보낸 날들은 웃지 않았던 날들이다. (서양속담, 희망속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','The worst wheel of the cart always creaks most.',' 가장  나쁜 바퀴가  가장  삐걱거린다.(빈 수레가 요란하다.) (서양속담, 겸손속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','Pleasure dies at the very moment when it charms us most.','쾌락이란 우리를  가장  즐겁게 해주는 바로 그 순간에 사라진다. (서양속담, 인내속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','The best things are the most difficult.',' 가장  좋은 것들은 아주 어렵다. (그리스속담, 노력속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','Empty vessels make the most sound.','빈 수레가 요란하다 (서양속담, 겸손속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','The outsider sees the best [most] of the game.','구경꾼이 게임을 더 잘(많이) 본다. (당사자는 제대로 판단을 못하는 수가 많다.) (서양속담, 지혜속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','They that govern the most make the least noise.',' 가장  잘 다스리는 자는 아무런 소리도 내지 않는다. (서양속담, 명예속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','The most learned are not the wisest.',' 가장  많이 배웠다고  가장  현명한 것은 아니다. (서양속담, 공부속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','Who knows most believes least.',' 가장  많이 아는 사람이  가장  적게 믿는다. (이탈리아속담, 지식속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','Who knows most forgives most.',' 가장  많이 아는 사람이  가장  많이 용서한다. (이탈리아속담, 지식속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','First impressions are most lasting.','첫 인상이  가장  오래 간다. (서양속담, 경험속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','Shallow streams make most din.','얕은 물이 큰 소음을 낸다. (서양속담, 겸손속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','A single grateful thought toward Heaven is the most complete prayer.','하늘을 향해 감사하는 생각은  가장  완전한 기도이다. (독일속담, 겸손속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','Great opportunities come to those who make the most of small ones.','큰 기적은 작은 기적들을 최대한 활용한 이들에게 찾아온다. (서양속담, 행운속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','The three most beautiful sight: a potato garden in bloom, a ship in sail, a woman after the birth of her child.','보기에  가장  아름다운 세 가지는 꽃이 핀 감자 밭, 돛 달고 가는 배, 아기를 낳은 여자다. (아일랜드속담, 아름다움속담)','2015-07-17 오후 9:59:16','출처:명언/속담',12),
 ('most','He remained at home all day, in bed most of the time.','그는 하루 종일 집에 있으면서  대부분 의 시간을 침대에서 보냈다.','2015-07-17 오후 9:59:17','',13),
 ('most','The day was the most appropriate day in the whole year.','그 날은 한해 중  가장  적절한 날이었다.','2015-07-17 오후 9:59:17','',13),
 ('most','Love was the most exalted expression of life.','사랑은 삶의  가장  고귀한 표현이다.','2015-07-17 오후 9:59:17','',13),
 ('most','The most unpleasant thing in the world.','세상에서  가장  불쾌한 것.','2015-07-17 오후 9:59:17','',13),
 ('most','We do most of our own work.','우리는 주로 자기 일을 해요.','2015-07-17 오후 9:59:17','',13),
 ('most','You have guessed most infallibly, he replied.','당신은  가장  정확하게 예상했다, 그가 대답했다.','2015-07-17 오후 9:59:17','',13),
 ('most','To the last her habits of life were most penurious.','그녀의 삶의 마지막 습관인 것은 가난이였다.','2015-07-17 오후 9:59:17','',13),
 ('most','He sat motionless most of the time.','그는  대부분 의 시간을 꼼짝없이 앉아있었다.','2015-07-17 오후 9:59:17','',13),
 ('most','These scones are the most delectable things!','이 스콘들은  가장  맛있는 것들이다.','2015-07-17 오후 9:59:17','',13),
 ('most','Shocky stuck to his point most positively.','Shocky는 그의 관점을  가장  긍정적으로 고수했다.','2015-07-17 오후 9:59:17','',13),
 ('most','A very respectable man, a most respectable man.','매우 존경받는 사람, 최고로 존경받는 사람.','2015-07-17 오후 9:59:17','',13),
 ('most','Let us make the most of it.','우리 그걸 최대한 이용해보자.','2015-07-17 오후 9:59:17','',13),
 ('most','It was the most charming garrulity he had ever heard.','그것은 그가 들었던 것 중에서  가장  매력적인 수다였다.','2015-07-17 오후 9:59:17','',13),
 ('most','He has brought a most beautiful photograph of the Parthenon.','그는 대단히 아름다운 파르테논 신전 사진을 가져왔다.','2015-07-17 오후 9:59:17','',13),
 ('most','And still the azure is most beautiful.','그리고 아직도, 하늘색은 제일 아름답다.','2015-07-17 오후 9:59:17','',13),
 ('most','It is a most inexpressible sorrow to me that I was not.','이것은  가장  깊은슬픔이였다 내가아닌나에게','2015-07-17 오후 9:59:17','',13),
 ('peaking','It also appears the (real estate) bubble is pretty well peaking out.','그것은 또한 부동산 경기 거품이 꽤 정점에 이르렀다는 걸 보여준다.','2015-07-17 오후 10:00:13','',0),
 ('peaking','Enrique Iglesias&#8217;s &#8216;I Like It&#8217; has now been on the Billboard Hot 100 for 38 weeks, peaking at No. 4.','Enrique Iglesias의 ‘I Like It’이 최고 순위는 4위를 찍고,빌보드 Hot 100에 38주째 이름을 올리고 있는 거네.','2015-07-17 오후 10:00:13','출처:다락원',0),
 ('peaking','The Shanghai bourse has lost almost half its value since peaking last autumn.','상하이증권거래소는 작년 가을 최고점을 찍고 거의 절반가량 폭락했다','2015-07-17 오후 10:00:15','',2),
 ('peaking','It also appears the (real estate) bubble is pretty well peaking out.','그것은 또한 부동산 경기 거품이 꽤 정점에 이르렀다는 걸 보여준다.','2015-07-17 오후 10:00:16','',12),
 ('peaking','The Shanghai bourse has lost almost half its value since peaking last autumn.','상하이증권거래소는 작년 가을 최고점을 찍고 거의 절반가량 폭락했다','2015-07-17 오후 10:00:16','',12),
 ('peaking','I remember one world-famous performer was peaking on mescaline when he came on stage.','내가 기억하기로 한 세계적 공연가는 무대에 설 때 메스칼린에 극도로 취해있었다.','2015-07-17 오후 10:00:17','',12),
 ('peaking','Enrique Iglesias&#8217;s &#8216;I Like It&#8217; has now been on the Billboard Hot 100 for 38 weeks, peaking at No. 4.','Enrique Iglesias의 ‘I Like It’이 최고 순위는 4위를 찍고,빌보드 Hot 100에 38주째 이름을 올리고 있는 거네.','2015-07-17 오후 10:00:17','출처:다락원',12);
