INSERT INTO `sentence` (`id`,`note`,`name`,`sentence`,`memo`,`dt`) VALUES 
 ('telsam','test','No named',' Happy  is a song written  produced  and performed by American singer and producer Pharrell Williams from the Despicable Me 2 soundtrack album  It also served as the lead single from Williams  second studio album  Girl  2014   It was first released on November 21  2013  alongside a long form music video  The song was reissued on December 16  2013  by Back Lot Music under exclusive license to Columbia Records  a division of Sony Music  1      Happy  is a midtempo soul song on which Williams s falsetto voice has been compared to Curtis Mayfield by critics  The song has been highly successful  peaking at No  1 in the United States  United Kingdom  Canada  Ireland  New Zealand  and 19 other countries  It is the best selling song of 2014 in the United States with 6 45 million copies sold for the year  3  as well as in the United Kingdom with 1 5 million copies sold for the year  4  It reached No  1 in the UK on a record setting three separate occasions and became the most downloaded song of all time in the UK in September 2014  5  It was nominated for an Academy Award for Best Original Song  In the week ending April 11  2015  it dropped out of the official UK top 75 chart after 70 consecutive weeks  6  A live rendition of the song won the Grammy Award for Best Pop Solo Performance at the 57th Annual Grammy Awards     The music video for the song was nominated for Best Male Video and Video of the Year at the 2014 MTV Video Music Awards  It also won the Grammy Award for Best Music Video at the 57th Annual Grammy Awards 7  8  The song was Billboard s number one single for 2014      Happy  was the best selling song of 2014 with sales of 13 9 million copies worldwide  becoming one of the best selling singles of all time  9 ','','2015-07-15 오후 3:50:47'),
 ('dragon','공부','No named','Chambers and Partners Defamation  Privacy Junior of the Year 2014 15    Adam specialises in defamation  privacy  media law  harassment and data protection  Many of his cases involve the Human Rights Act and the interplay between articles 8 and 10 of the European Convention  In addition to advising and acting for or against almost all of the major media organisations  he is regularly instructed to act for or against public authorities  He has also built up an overseas practice being instructed in claims in Holland  Dominica  Barbados  the Bahamas and Malaysia     In the current Chambers  Partners Adam is in the top rank  band 1  for defamation and privacy work and is said to to be always assured in his approach to advice and very clear about the goals that the client needs to achieve and how to achieve them  He finds points others don t necesssarily find  In Legal 500 he is said to be a star of the junior Bar with an excellent understanding of the practicalities of media law     Adam is regularly instructed to appear led and unled at trial  on appeals  on applications for injunctions and at other interim hearings  In 2015 he has appeared in the Supreme Court  in OPO led by Matthew Nicklin QC  and in the Privy Council  in Pinard Byrne v Linton unled   In 2014 he appeared unled in the Court of Appeal twice  in both cases successfully  Crawford v Jenkins and Thompson v James   In the High Court in Thompson v James he acted unled for Carmarthenshire County Council and its chief executive Mark James in a 6 day libel trial against a blogger  The Council and Mr James successfully defended the claim and Mr James won his counter claim and was awarded 25 000 damages  decision upheld on appeal      Other significant instructions include Lillie  Reed v Newcastle City Council where he was in Court for over 79 days and was jointly short listed for Human Rights Lawyer of the Year  Miller v ANL  2005   Miller v ANL  2012   and on appeal   the Leveson Inquiry where he was junior Counsel for the Telegraph Media Group  and the News International Voicemail Interception Scheme where he acted for over 70 applicants between 2012 and 2014 and appeared  led  at one of only two adjudications to take place under the Scheme     He is regularly advises on reputation management matters more generally  In 2014 5 he has advised a number of individuals and companies who have been informed that they are to be the subject of critical documentaries on how to respond and address allegations     Significant recent and ongoing instructions include ','','2015-07-17 오후 9:10:47'),
 ('dragon','공부','No named','If the momentum diffusivity is low  i e  the liquid does not move easily due to density differences  and thermal diffusivity is low  i e  the liquid has low thermal conductivity  then the heat transfer from the boundary becomes very difficult as the liquid absorbing heat is inefficient in absorbing heat at the same time it doesn t move from its place giving place to cooler fluid  So heat transfer decreases significantly low  Prandtl number however depends on the values   ','','2015-07-17 오후 9:38:10'),
 ('dragon','공부','No named','If the momentum diffusivity is low  i e  the liquid does not move easily due to density differences  and thermal diffusivity is low  i e  the liquid has low thermal conductivity  then the heat transfer from the boundary becomes very difficult as the liquid absorbing heat is inefficient in absorbing heat at the same time it doesn t move from its place giving place to cooler fluid  So heat transfer decreases significantly low  Prandtl number however depends on the values   ','','2015-07-17 오후 9:38:19'),
