 ('dragon','fdgsdfg','No named',' Happy  is a song written  produced  and performed by American singer and producer Pharrell Williams from the Despicable Me 2 soundtrack album  It also served as the lead single from Williams  second studio album  Girl  2014   It was first released on November 21  2013  alongside a long form music video  The song was reissued on December 16  2013  by Back Lot Music under exclusive license to Columbia Records  a division of Sony Music  1      Happy  is a midtempo soul song on which Williams s falsetto voice has been compared to Curtis Mayfield by critics  The song has been highly successful  peaking at No  1 in the United States  United Kingdom  Canada  Ireland  New Zealand  and 19 other countries  It is the best selling song of 2014 in the United States with 6 45 million copies sold for the year  3  as well as in the United Kingdom with 1 5 million copies sold for the year  4  It reached No  1 in the UK on a record setting three separate occasions and became the most downloaded song of all time in the UK in September 2014  5  It was nominated for an Academy Award for Best Original Song  In the week ending April 11  2015  it dropped out of the official UK top 75 chart after 70 consecutive weeks  6  A live rendition of the song won the Grammy Award for Best Pop Solo Performance at the 57th Annual Grammy Awards ','','2015-07-17 오후 9:52:21');
